import React, { useState, ChangeEvent } from 'react';

interface ClientInfo {
  name: string;
  dateOfBirth: string;
  identificationNumber: string;
  address: string;
  city: string;
  state: string;
  zipCode: string;
  telephone: string;
  otherInformation: string;
}

interface ConsentInfo {
  disclosureRecipients: string;
  reasonForDisclosure: string;
  recordsShared: {
    allRecords: boolean;
    attachedList: boolean;
    selectedRecords: {
      familyHistory: boolean;
      treatmentPlans: boolean;
      paymentRecords: boolean;
      assessments: boolean;
      education: boolean;
      mentalHealth: string;
      healthCare: string;
      other: string;
    };
  };
}

interface FormData {
  clientInfo: ClientInfo;
  consentInfo: ConsentInfo;
}

const DSHSConsentForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    clientInfo: {
      name: '',
      dateOfBirth: '',
      identificationNumber: '',
      address: '',
      city: '',
      state: 'Washington',
      zipCode: '',
      telephone: '',
      otherInformation: '',
    },
    consentInfo: {
      disclosureRecipients: '',
      reasonForDisclosure: '',
      recordsShared: {
        allRecords: false,
        attachedList: false,
        selectedRecords: {
          familyHistory: false,
          treatmentPlans: false,
          paymentRecords: false,
          assessments: false,
          education: false,
          mentalHealth: '',
          healthCare: '',
          other: '',
        },
      },
    },
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLTextAreaElement | HTMLSelectElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;
    setFormData((prev) => ({
      ...prev,
      consentInfo: {
        ...prev.consentInfo,
        [name]: type === 'checkbox' ? checked : value,
      },
    }));
  };

  return (
    <div style={{ maxWidth: '1000px', margin: '0 auto', padding: '20px' }}>
      <div style={{ textAlign: 'center', marginBottom: '20px' }}>
        <img src="/path-to-dshs-logo.png" alt="DSHS Logo" style={{ height: '60px' }} />
        <h1 style={{ fontSize: '24px', fontWeight: 'bold', margin: '20px 0' }}>Consent Form</h1>
      </div>

      <form style={{ border: '1px solid #ccc', padding: '20px', borderRadius: '8px' }}>
        {/* Client Information */}
        <div style={{ marginBottom: '20px' }}>
          <h2 style={{ borderBottom: '2px solid #333', paddingBottom: '5px', marginBottom: '15px' }}>
            Client Information
          </h2>
          <input
            type="text"
            name="telephone"
            value={formData.clientInfo.telephone}
            onChange={handleChange}
            placeholder="TELEPHONE NUMBER (INCLUDE AREA CODE)"
            style={{ width: '100%', padding: '8px', border: '1px solid #ccc', borderRadius: '4px' }}
          />
          <textarea
            name="otherInformation"
            value={formData.clientInfo.otherInformation}
            onChange={handleChange}
            placeholder="OTHER INFORMATION"
            style={{ width: '100%', padding: '8px', border: '1px solid #ccc', borderRadius: '4px', height: '100px', marginTop: '15px' }}
          />
        </div>

        {/* Consent Section */}
        <div style={{ marginBottom: '20px' }}>
          <h2 style={{ borderBottom: '2px solid #333', paddingBottom: '5px', marginBottom: '15px' }}>
            Consent
          </h2>
          <p>
            I consent to the use of confidential information about me within DSHS to plan, provide, and coordinate services,
            treatment, payments, and benefits.
          </p>

          <label>Please select recipients:</label>
          <select name="disclosureRecipients" value={formData.consentInfo.disclosureRecipients} onChange={handleChange} style={{ width: '100%', padding: '8px', marginTop: '10px' }}>
            <option value="">-- Select --</option>
            <option value="Health care providers">Health care providers</option>
            <option value="Mental health care providers">Mental health care providers</option>
            <option value="Substance use disorder service providers">Substance use disorder service providers</option>
            <option value="Housing programs">Housing programs</option>
            <option value="School districts or colleges">School districts or colleges</option>
            <option value="Department of Corrections">Department of Corrections</option>
            <option value="Employment Security Department">Employment Security Department</option>
            <option value="Social Security Administration">Social Security Administration</option>
            <option value="See attached list">See attached list</option>
            <option value="Other">Other</option>
          </select>
        </div>

        <div style={{ marginBottom: '20px' }}>
          <h3>Reason for disclosure:</h3>
          <label><input type="radio" name="reasonForDisclosure" value="Continuity of care" onChange={handleChange} /> Continuity of care</label><br />
          <label><input type="radio" name="reasonForDisclosure" value="Legal" onChange={handleChange} /> Legal</label><br />
          <label><input type="radio" name="reasonForDisclosure" value="Personal" onChange={handleChange} /> Personal</label><br />
          <label><input type="radio" name="reasonForDisclosure" value="Other" onChange={handleChange} /> Other</label>
        </div>

        <div style={{ marginBottom: '20px' }}>
          <h3>Records to be shared:</h3>
          <label><input type="checkbox" name="allRecords" checked={formData.consentInfo.recordsShared.allRecords} onChange={handleChange} /> All my client records</label><br />
          <label><input type="checkbox" name="attachedList" checked={formData.consentInfo.recordsShared.attachedList} onChange={handleChange} /> Records on attached list</label><br />
          <label><input type="checkbox" name="selectedRecords.familyHistory" checked={formData.consentInfo.recordsShared.selectedRecords.familyHistory} onChange={handleChange} /> Family, social and employment history</label><br />
          <label><input type="checkbox" name="selectedRecords.treatmentPlans" checked={formData.consentInfo.recordsShared.selectedRecords.treatmentPlans} onChange={handleChange} /> Treatment or care plans</label><br />
          <label><input type="checkbox" name="selectedRecords.paymentRecords" checked={formData.consentInfo.recordsShared.selectedRecords.paymentRecords} onChange={handleChange} /> Payment records</label><br />
          <label><input type="checkbox" name="selectedRecords.assessments" checked={formData.consentInfo.recordsShared.selectedRecords.assessments} onChange={handleChange} /> Individual assessments</label><br />
          <label>Health care information (specify): <input type="text" name="selectedRecords.healthCare" value={formData.consentInfo.recordsShared.selectedRecords.healthCare} onChange={handleChange} /></label><br />
          <label>Other (list): <input type="text" name="selectedRecords.other" value={formData.consentInfo.recordsShared.selectedRecords.other} onChange={handleChange} /></label>
        </div>

        <button type="submit" style={{ backgroundColor: '#0066cc', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '4px', cursor: 'pointer', float: 'right' }}>
          Submit Consent Form
        </button>
      </form>
    </div>
  );
};

export default DSHSConsentForm;
